import { View, Text } from "react-native";
import React, { useEffect } from "react";
import City from "./city";

import { apiGet } from "../../apis/request";

const Dashboard = () => {
  useEffect(() => {
    apiGet({ path: "city" }).then((res) => {});
  });
  return (
    <View>
      <City />
    </View>
  );
};

export default Dashboard;
